CREATE SCHEMA IF NOT EXISTS `avp36` DEFAULT CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci ;
USE `avp36` ;


-- Step 1: Define tables without foreign key dependencies

-- -----------------------------------------------------
-- Table `avp36`.`survey`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `avp36`.`survey` ;

CREATE TABLE IF NOT EXISTS `avp36`.`survey` (
  `survey_id` INT NOT NULL AUTO_INCREMENT COMMENT 'E.g., the name of a Qualtrics survey. Different surveys can have the same measure repeated across them.',
  `survey_name` VARCHAR(45) NOT NULL,
  `administration_method` VARCHAR(45) NOT NULL COMMENT 'e.g., lab, self-administered, experience sampling',
  `recording_device` VARCHAR(45) NOT NULL COMMENT 'e.g., computer, mobile',
  `is_repeated` TINYINT NOT NULL COMMENT 'Is the survey a repeated measure? Do participants complete the exact survey more than once?',
  PRIMARY KEY (`survey_id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;



-- -----------------------------------------------------
-- Table `avp36`.`measure`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `avp36`.`measure` ;

CREATE TABLE IF NOT EXISTS `avp36`.`measure` (
  `measure_id` INT NOT NULL AUTO_INCREMENT COMMENT 'Identifies a specific psychological instrument/material/measure with a set of items (short and long-form versions of the same measure should be identified separately).',
  `construct_name` VARCHAR(45) NULL DEFAULT NULL COMMENT 'Name of psychological construct or latent skill - can have multiple measures for the same construct (e.g., depression)',
  `instrument` TEXT NULL DEFAULT NULL COMMENT 'Name of the specific measure/instrument (e.g., Beck’s Depression Inventory)',
  `measure_type` VARCHAR(45) NULL DEFAULT NULL COMMENT 'e.g., self-report, skill assessment',
  `scoring` VARCHAR(45) NULL DEFAULT NULL COMMENT 'e.g., Likert-type ratings, scored for accuracy/correctness',
  `variable_stem` VARCHAR(45) NULL DEFAULT NULL COMMENT 'Prefix for items in the original data (question names in Qualtrics). For example, items in the Beck’s Depression Inventory may be named bdi1, bdi2, bdi3, etc.',
  PRIMARY KEY (`measure_id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;


-- -----------------------------------------------------
-- Table `avp36`.`response_option`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `avp36`.`response_option` ;

CREATE TABLE IF NOT EXISTS `avp36`.`response_option` (
  `response_option_id` INT NOT NULL AUTO_INCREMENT,
  `value` INT NOT NULL COMMENT 'Numeric value associated with a response option, used for quantitative analysis',
  `label` TEXT NOT NULL COMMENT 'Text label associated with response option (e.g., Strongly agree)',
  PRIMARY KEY (`response_option_id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;


-- -----------------------------------------------------
-- Table `avp36`.`wave`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `avp36`.`wave` ;

CREATE TABLE IF NOT EXISTS `avp36`.`wave` (
  `wave_id` INT NOT NULL AUTO_INCREMENT,
  `start_date` DATETIME NOT NULL,
  PRIMARY KEY (`wave_id`))
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;


-- Step 2: Define tables that depend only on the tables in step 1 (survey, measure, response_option, wave)


-- -----------------------------------------------------
-- Table `avp36`.`participant`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `avp36`.`participant` ;

CREATE TABLE IF NOT EXISTS `avp36`.`participant` (
  `participant_id` INT NOT NULL AUTO_INCREMENT COMMENT 'Identifies a unique participant enrolled in the study',
  `experimental_condition` VARCHAR(45) NOT NULL COMMENT 'Assigned experimental condition',
  `wave_id` INT NOT NULL COMMENT 'References the date the participant was enrolled in the study',
  PRIMARY KEY (`participant_id`),
  INDEX `fk_participant_wave_idx` (`wave_id` ASC) VISIBLE,
  CONSTRAINT `fk_participant_wave_id`
    FOREIGN KEY (`wave_id`)
    REFERENCES `avp36`.`wave` (`wave_id`)
    ON DELETE RESTRICT
    ON UPDATE CASCADE)
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;


-- -----------------------------------------------------
-- Table `avp36`.`expected_response`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `avp36`.`expected_response` ;

CREATE TABLE IF NOT EXISTS `avp36`.`expected_response` (
  `expected_response_id` INT NOT NULL AUTO_INCREMENT,
  `days_from_start` INT NOT NULL COMMENT 'Number of days since study enrollment',
  `survey_id` INT NOT NULL,
  PRIMARY KEY (`expected_response_id`),
  INDEX `fk_expected_response_survey_idx` (`survey_id` ASC) VISIBLE,
  CONSTRAINT `fk_expected_response_survey_id`
    FOREIGN KEY (`survey_id`)
    REFERENCES `avp36`.`survey` (`survey_id`)
    ON DELETE RESTRICT
    ON UPDATE CASCADE)
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;



-- -----------------------------------------------------
-- Table `avp36`.`item`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `avp36`.`item` ;

CREATE TABLE IF NOT EXISTS `avp36`.`item` (
  `item_id` INT NOT NULL AUTO_INCREMENT COMMENT 'Unique identifier for each item associated with a measure',
  `measure_id` INT NOT NULL,
  `text_prompt` TEXT NULL DEFAULT NULL COMMENT 'Verbal prompt (optional)',
  `item_number` INT NOT NULL COMMENT 'Number associated with variable name (to be combined with measure.variable_stem)',
  `is_reverse_scored` TINYINT NOT NULL COMMENT 'For Likert items, is this a reverse-scored item?',
  PRIMARY KEY (`item_id`, `measure_id`),
  INDEX `fk_item_measure_idx` (`measure_id` ASC) VISIBLE,
  CONSTRAINT `fk_item_measure_id`
    FOREIGN KEY (`measure_id`)
    REFERENCES `avp36`.`measure` (`measure_id`)
    ON DELETE CASCADE
    ON UPDATE CASCADE)
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;



-- Step 3: Define tables that depend on combinations from steps 1 and 2



-- -----------------------------------------------------
-- Table `avp36`.`survey_measure`
