DROP TABLE IF EXISTS `avp36`.`survey_measure` ;

CREATE TABLE IF NOT EXISTS `avp36`.`survey_measure` (
  `survey_id` INT NOT NULL,
  `measure_id` INT NOT NULL,
  PRIMARY KEY (`survey_id`, `measure_id`),
  INDEX `fk_survey_measure_measure_idx` (`measure_id` ASC) VISIBLE,
  INDEX `fk_survey_measure_survey_idx` (`survey_id` ASC) VISIBLE,
  CONSTRAINT `fk_survey_measure_measure_id`
    FOREIGN KEY (`measure_id`)
    REFERENCES `avp36`.`measure` (`measure_id`)
    ON DELETE CASCADE
    ON UPDATE CASCADE,
  CONSTRAINT `fk_survey_measure_survey_id`
    FOREIGN KEY (`survey_id`)
    REFERENCES `avp36`.`survey` (`survey_id`)
    ON DELETE CASCADE
    ON UPDATE CASCADE)
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;


-- -----------------------------------------------------
-- Table `avp36`.`survey_response`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `avp36`.`survey_response` ;

CREATE TABLE IF NOT EXISTS `avp36`.`survey_response` (
  `survey_response_id` INT NOT NULL AUTO_INCREMENT COMMENT 'E.g., a Qualtrics response ID. Identifies a unique survey response from a participant.',
  `participant_id` INT NOT NULL,
  `expected_response_id` INT NOT NULL,
  -- `survey_id` INT NOT NULL,
  `start_date_time` DATETIME NULL DEFAULT NULL,
  `end_date_time` DATETIME NULL DEFAULT NULL,
  PRIMARY KEY (`survey_response_id`),
  INDEX `fk_survey_response_participant_idx` (`participant_id` ASC) VISIBLE,
