  CONSTRAINT `fk_survey_response_participant_id`
    FOREIGN KEY (`participant_id`)
    REFERENCES `avp36`.`participant` (`participant_id`)
    ON DELETE RESTRICT
    ON UPDATE CASCADE,
  CONSTRAINT `fk_survey_response_expected_response_id`
    FOREIGN KEY (`expected_response_id`)
    REFERENCES `avp36`.`expected_response` (`expected_response_id`)
    ON DELETE CASCADE
    ON UPDATE CASCADE)
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;




-- -----------------------------------------------------
-- Table `avp36`.`item_response_option`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `avp36`.`item_response_option` ;

CREATE TABLE IF NOT EXISTS `avp36`.`item_response_option` (
  `item_id` INT NOT NULL,
  `measure_id` INT NOT NULL,
  `response_option_id` INT NOT NULL,
  PRIMARY KEY (`item_id`, `measure_id`, `response_option_id`),
  INDEX `fk_item_response_option_response_option_idx` (`response_option_id` ASC) VISIBLE,
  INDEX `fk_item_response_option_item_idx` (`item_id` ASC, `measure_id` ASC) VISIBLE,
