    ON UPDATE CASCADE,
  CONSTRAINT `fk_item_response_option_response_option_id`
    FOREIGN KEY (`response_option_id`)
    REFERENCES `avp36`.`response_option` (`response_option_id`)
    ON DELETE CASCADE
    ON UPDATE CASCADE)
ENGINE = InnoDB
DEFAULT CHARACTER SET = utf8mb4
COLLATE = utf8mb4_0900_ai_ci;



