DROP VIEW IF EXISTS vw_participant_overview;

CREATE VIEW vw_participant_overview AS
SELECT 
    p.participant_id,
    p.experimental_condition,
    w.wave_id,
    w.start_date AS enrollment_date,
    COUNT(DISTINCT sr.survey_response_id) AS total_responses,
    COUNT(DISTINCT er.expected_response_id) AS expected_responses,
    COUNT(DISTINCT sr.survey_response_id) / COUNT(DISTINCT er.expected_response_id) AS compliance_rate
FROM 
    participant p
JOIN wave w ON p.wave_id = w.wave_id
LEFT JOIN expected_response er ON 1=1
LEFT JOIN survey_response sr ON p.participant_id = sr.participant_id AND er.expected_response_id = sr.expected_response_id
GROUP BY 
    p.participant_id, p.experimental_condition, w.start_date;
    

DROP VIEW IF EXISTS vw_survey_response_completion;

CREATE VIEW vw_survey_response_completion AS
SELECT 
    sr.survey_response_id,
    sr.participant_id,
    p.experimental_condition,
    s.survey_name,
    s.administration_method,
    sr.start_date_time,
    sr.end_date_time,
    TIMESTAMPDIFF(SECOND, sr.start_date_time, sr.end_date_time) AS duration_seconds,
    COUNT(DISTINCT ir.measure_id) AS total_measures,
    COUNT(ir.item_response_id) AS total_items,
    COUNT(CASE WHEN ir.response_option_id IS NOT NULL THEN 1 END) AS complete_item_responses
FROM 
    survey_response sr
JOIN participant p ON sr.participant_id = p.participant_id
JOIN expected_response er ON sr.expected_response_id = er.expected_response_id
JOIN survey s ON er.survey_id = s.survey_id
LEFT JOIN item_response ir ON sr.survey_response_id = ir.survey_response_id
GROUP BY 
    sr.survey_response_id, sr.participant_id, p.experimental_condition, 
    s.survey_name, s.administration_method, 
    sr.start_date_time, sr.end_date_time;
    

DROP VIEW IF EXISTS vw_missing_data;

CREATE VIEW vw_missing_data AS
SELECT 
    p.participant_id,
    p.experimental_condition,
    er.expected_response_id,
    s.survey_name,
    s.administration_method,
    s.recording_device,
    er.days_from_start,
    w.wave_id,
    w.start_date AS enrollment_date,
    CASE WHEN sr.survey_response_id IS NOT NULL THEN 1 ELSE 0 END AS is_complete
FROM 
    participant p
CROSS JOIN expected_response er
JOIN survey s ON er.survey_id = s.survey_id
JOIN wave w ON p.wave_id = w.wave_id
LEFT JOIN survey_response sr ON p.participant_id = sr.participant_id AND er.expected_response_id = sr.expected_response_id
WHERE 
    DATE_ADD(w.start_date, INTERVAL er.days_from_start DAY) <= CURDATE()
ORDER BY 
    p.participant_id, er.days_from_start;
    

-- This procedure takes an expected response ID and a measure ID and returns a table with participant responses (converted to values) for all items on a measure at a specific timepoint. This can be pivoted in R for psychometric analyses.

USE `avp36`;
DROP PROCEDURE IF EXISTS `sp_get_item_responses`;

DELIMITER $$
CREATE PROCEDURE `sp_get_item_responses` (IN expected_response_id_param INT, IN measure_id_param INT)
BEGIN
    -- Declare variables
    DECLARE er_exists INT;
    DECLARE m_exists INT;
    DECLARE association_exists INT;
    
    -- Validate that expected_response_id exists
    SELECT COUNT(*) INTO er_exists FROM expected_response WHERE expected_response_id = expected_response_id_param;
    
    -- Validate that measure_id exists
    SELECT COUNT(*) INTO m_exists FROM measure WHERE measure_id = measure_id_param;
    
    -- Validate that the measure is associated with the expected response
    SELECT COUNT(*) INTO association_exists
    FROM expected_response er
    JOIN survey s ON er.survey_id = s.survey_id
    JOIN survey_measure sm ON s.survey_id = sm.survey_id
    WHERE er.expected_response_id = expected_response_id_param
    AND sm.measure_id = measure_id_param;
    
    -- Return appropriate warnings if validations fail
    IF er_exists = 0 THEN
        SELECT 'Warning: Please provide a valid expected response ID' AS message;
    ELSEIF m_exists = 0 THEN
        SELECT 'Warning: Please provide a valid measure ID' AS message;
    ELSEIF association_exists = 0 THEN
        SELECT 'Warning: Provided measure not associated with expected response' AS message;
    ELSE
        -- Return the unpivoted data if all validations pass
        SELECT 
            sr.participant_id,
            sr.survey_response_id,
            CONCAT(m.variable_stem, '_', i.item_number) AS variable_name,
            ro.value
        FROM 
            item_response ir
        JOIN 
            survey_response sr ON ir.survey_response_id = sr.survey_response_id
        JOIN 
            measure m ON ir.measure_id = m.measure_id
        JOIN 
            item i ON ir.item_id = i.item_id AND ir.measure_id = i.measure_id
        JOIN 
            response_option ro ON ir.response_option_id = ro.response_option_id
        WHERE 
            ir.measure_id = measure_id_param
            AND sr.expected_response_id = expected_response_id_param
        ORDER BY
            sr.participant_id,
            sr.survey_response_id,
            i.item_number;
    END IF;
END$$
DELIMITER ;

-- This procedure takes a measure ID and returns a table that includes item prompts and response options

USE `avp36`;
DROP PROCEDURE IF EXISTS `sp_get_measure_items`;

DELIMITER $$
CREATE PROCEDURE `sp_get_measure_items` (IN measure_id_param INT)
BEGIN
    SELECT 
        i.item_id,
        CONCAT(m.variable_stem, '_', i.item_number) AS variable_name,
        i.text_prompt,
        ro.label AS response_option_label,
        ro.value AS response_option_value
    FROM 
        `item` i
    JOIN 
        `measure` m ON i.measure_id = m.measure_id
    JOIN 
        `item_response_option` iro ON i.item_id = iro.item_id AND i.measure_id = iro.measure_id
    JOIN 
        `response_option` ro ON iro.response_option_id = ro.response_option_id
    WHERE 
        i.measure_id = measure_id_param
    ORDER BY 
        i.item_id, ro.value;
END$$
DELIMITER ;

-- -------------------------------------------------------
-- measure_scores Table and Refresh Procedure
-- -------------------------------------------------------
-- Purpose:
--   This materialized table stores precomputed measure scores from survey responses 
--   to improve query performance for the research dashboard. It eliminates the need
--   for expensive joins and calculations at query time.
--
-- Table Structure:
--   * survey_response_id, measure_id: Composite primary key
--   * participant_id, experimental_condition: Participant information
--   * days_from_start: Timeline information for longitudinal analysis
--   * measure_id, construct_name, instrument: Measure identifiers
--   * mean_score, total_score: Calculated metrics
--   * items_answered, total_items, completion_rate: Response completeness metrics
--   * last_refresh: Timestamp of when the data was last updated
--
-- The refresh_measure_scores procedure:
--   * Truncates and rebuilds the entire measure_scores table
--   * Aggregates item response data for each survey response and measure combination
--   * Calculates mean scores, total scores, and completion metrics
--   * Updates the last_refresh timestamp
--
-- Usage:
--   * Call this procedure whenever source data changes significantly
--   * Can be scheduled to run during off-hours or triggered manually
--   * Query measure_scores directly instead of computing these metrics on demand
-- -------------------------------------------------------

USE `avp36`;

DROP TABLE IF EXISTS measure_scores;

CREATE TABLE measure_scores (
    survey_response_id INT,
    participant_id INT,
    experimental_condition VARCHAR(45),
    days_from_start INT,
    measure_id INT,
    construct_name VARCHAR(45),
    instrument TEXT,
    mean_score DOUBLE,    
    total_score DOUBLE,    
    items_answered INT,
    total_items INT,
    completion_rate DOUBLE, 
    last_refresh TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    PRIMARY KEY (survey_response_id, measure_id),
    INDEX idx_participant (participant_id),
    INDEX idx_measure (measure_id),
    INDEX idx_condition (experimental_condition),
    INDEX idx_days (days_from_start)
);

DROP PROCEDURE IF EXISTS `sp_refresh_measure_scores`;

DELIMITER //
CREATE PROCEDURE sp_refresh_measure_scores()
BEGIN
    -- Create a temporary variable to store the refresh timestamp
    SET @refresh_time = CURRENT_TIMESTAMP;
    
    -- Clear the existing data
    TRUNCATE TABLE measure_scores;
    
    -- Insert fresh data (with the timestamp already included)
        survey_response_id, participant_id, experimental_condition,
        days_from_start, measure_id, construct_name, instrument,
        mean_score, total_score, items_answered, total_items, completion_rate,
        last_refresh
    )
    SELECT 
        sr.survey_response_id,
        sr.participant_id,
        p.experimental_condition,
        er.days_from_start,
        m.measure_id,
        m.construct_name,
        m.instrument,
        AVG(ro.value) AS mean_score,
        SUM(ro.value) AS total_score,
        COUNT(ir.item_id) AS items_answered,
        (SELECT COUNT(*) FROM item WHERE measure_id = m.measure_id) AS total_items,
        COUNT(ir.item_id) / (SELECT COUNT(*) FROM item WHERE measure_id = m.measure_id) AS completion_rate,
        @refresh_time  -- Set the timestamp during insert instead of update
    FROM 
        survey_response sr
    JOIN participant p ON sr.participant_id = p.participant_id
    JOIN expected_response er ON sr.expected_response_id = er.expected_response_id
    JOIN survey_measure sm ON er.survey_id = sm.survey_id
    JOIN measure m ON sm.measure_id = m.measure_id
    LEFT JOIN item_response ir ON sr.survey_response_id = ir.survey_response_id AND ir.measure_id = m.measure_id
    LEFT JOIN response_option ro ON ir.response_option_id = ro.response_option_id
    WHERE ir.response_option_id IS NOT NULL
    GROUP BY 
        sr.survey_response_id, sr.participant_id, p.experimental_condition, er.days_from_start, 
        m.measure_id, m.construct_name, m.instrument;
END //
DELIMITER ;